import React, { useState } from 'react';
import { Container, Dropdown, Form, InputGroup, Button } from 'react-bootstrap';
import { Link, useHistory } from 'react-router-dom';
import { useDispatch, useSelector } from 'react-redux';
import { logout } from '../actions/userActions';
import { useCart } from "../cart/CartProvider";   // ðŸ‘ˆ add

// ... BrandSearch unchanged ...

export default function BrandBar() {
  const dispatch = useDispatch();
  const history = useHistory();

  const { userInfo } = useSelector((state) => state.userLoginReducer) || {};
  const { items: wishlistItems = [] } = useSelector((s) => s.wishlist || {});
  const wishCount = wishlistItems.length || 0;

  const cart = useCart();                     // ðŸ‘ˆ cart context
  const cartCount = cart.count || 0;

  const logoutHandler = () => {
    dispatch(logout());
    history.push('/login');
    window.location.reload();
  };

  return (
    <div className="brandbar">
      <Container className="brandbar-inner">
        <div className="brandbar-left" />
        <div className="brandbar-logo">
          <Link to="/"><img src="/brand/logob.svg" alt="Beauty Shop" className="brand-logo-img" /></Link>
        </div>

        <div className="brandbar-icons">
          <BrandSearch />

          {/* Wishlist */}
          <Link to="/wishlist" title="Wishlist" className="icon-link" style={{ position:'relative' }}>
            <i className="fas fa-heart" />
            {wishCount > 0 && (
              <span className="icon-badge">{wishCount}</span>
            )}
          </Link>

          {/* ðŸ›’ Cart icon (opens drawer) */}
          <button
            type="button"
            title="Panier"
            className="icon-link btn btn-link p-0"
            style={{ position:'relative' }}
            onClick={cart.open}
            aria-label="Ouvrir le panier"
          >
            <i className="fas fa-shopping-bag" />
            {cartCount > 0 && <span className="icon-badge">{cartCount}</span>}
          </button>

          {/* User dropdown ... unchanged */}
          {userInfo ? (
            <Dropdown align="end">
              <Dropdown.Toggle as="button" className="icon-link btn btn-link p-0 brand-user-toggle" aria-label="User menu">
                <i className="fas fa-user" />
              </Dropdown.Toggle>
              <Dropdown.Menu className="brand-user-menu">
                <Dropdown.Header className="text-capitalize">{userInfo.username}</Dropdown.Header>
                <Dropdown.Item as={Link} to="/account">Account Settings</Dropdown.Item>
                <Dropdown.Item as={Link} to="/all-orders/">All Orders</Dropdown.Item>
                {userInfo.admin && <>
                  <Dropdown.Divider />
                  <Dropdown.Item as={Link} to="/new-product/">Add Product</Dropdown.Item>
                </>}
                <Dropdown.Divider />
                <Dropdown.Item onClick={logoutHandler}>Logout</Dropdown.Item>
              </Dropdown.Menu>
            </Dropdown>
          ) : (
            <Link to="/login" title="Login" className="icon-link"><i className="fas fa-user" /></Link>
          )}
        </div>
      </Container>
    </div>
  );
}
